    <style>
        svg{
            width:200px;
            height:200px;
        }
        #rightarm{
            transform: rotateX(0deg) rotateY(0deg) rotateZ(0deg); 
            transform-origin: 206px 215px;
        }
        svg:hover #leftarm{
            transform: rotateX(0deg) rotateY(0deg) rotateZ(-51deg);
            transform-origin: 81px 215px;
        }
        #leftarm{
            transform: rotateX(0deg) rotateY(0deg) rotateZ(0deg); 
            transform-origin: 81px 215px;
            transition-duration: 1s;
        }
      svg:hover #rightarm{
        animation: guy 4s linear infinite;
        transition: 1s;
    }
    @keyframes guy{
        0%,30% {
            transform: rotateX(0deg) rotateY(0deg) rotateZ(0deg); 
        }
        30%,60%{
            transform: rotateX(0deg) rotateY(0deg) rotateZ(64deg);
        }
        60%,100%{
            transform: rotateX(0deg) rotateY(0deg) rotateZ(0deg); 
        }
    }
